class ColorsPickerUtil_ColorsPickerUtil  {
    /**
     * åå»ºDOM canvas
     * @param height canvas é«åº¦
     * @param width canvas å®½åº¦
     *
     */
    static createCanvas (height, width){
        var canvas = document.createElement("canvas");
        canvas.height = height;
        canvas.width = width;

        return canvas.getContext("2d");
    }

    /**
     * çº¿æ§æ¸åã
     * Parameters:
     * x0 - {Number} æ¸åèµ·ç¹ã
     * y0 - {Number}
     * x1 - {Number} æ¸åç»ç¹ã
     * y1 - {Number}
     * colorList - {Array} é¢è²åè¡¨ã
     *
     * Returns:
     * {CanvasGradient} Cavans æ¸åé¢è²ã
     */
    static getLinearGradient (x0, y0, x1, y1, colorList){
        if (!this._ctx) {
            this._ctx = this.getContext();
        }
        var gradient = this._ctx.createLinearGradient(x0, y0, x1, y1);
        var leng = colorList.length;
        var add = 1/(leng -1);
        var offset = 0;
        for (var i = 0; i < leng; i++) {
            gradient.addColorStop(offset, colorList[i]);
            offset += add;
        }
        gradient.__nonRecursion = true;
        return gradient;
    }

    /**
     * è·å Cavans ä¸ä¸æ
     *
     * Returns:
     * {Object} Cavans ä¸ä¸æã
     */
    static getContext () {
        if (!this._ctx) {
            this._ctx = document.createElement('canvas').getContext('2d');
        }
        return this._ctx;
    }

    /**
     * è·åä¸¤ç§é¢è²ä¹é´æ¸åé¢è²æ°ç»ã
     *
     * Parameters:
     * start - {color} èµ·å§é¢è²ã
     * end - {color} ç»æé¢è²ã
     * step - {Number} æ¸åçº§æ°ã
     * colorList - {Array} é¢è²åè¡¨ã
     *
     * Returns:
     * {Array} é¢è²æ°ç»ã
     */
    static getStepColors (start, end, step){
        start = ColorsPickerUtil_ColorRender.toRGBA(start);
        end = ColorsPickerUtil_ColorRender.toRGBA(end);
        start = ColorsPickerUtil_ColorRender.getData(start);
        end = ColorsPickerUtil_ColorRender.getData(end);

        var colors = [];
        var stepR = (end[0] - start[0]) / step;
        var stepG = (end[1] - start[1]) / step;
        var stepB = (end[2] - start[2]) / step;
        var stepA = (end[3] - start[3]) / step;
        // çæé¢è²éå
        // fix by linfeng é¢è²å ç§¯
        for (var i = 0, r = start[0], g = start[1], b = start[2], a = start[3]; i < step; i++) {
            colors[i] = ColorsPickerUtil_ColorRender.toColor([
                ColorsPickerUtil_ColorRender.adjust(Math.floor(r), [ 0, 255 ]),
                ColorsPickerUtil_ColorRender.adjust(Math.floor(g), [ 0, 255 ]),
                ColorsPickerUtil_ColorRender.adjust(Math.floor(b), [ 0, 255 ]),
                a.toFixed(4) - 0
            ],'hex');
            r += stepR;
            g += stepG;
            b += stepB;
            a += stepA;
        }
        r = end[0];
        g = end[1];
        b = end[2];
        a = end[3];
        colors[i] = ColorsPickerUtil_ColorRender.toColor([r, g, b, a], 'hex');
        return colors;
    }

    /**
     * APIMethod: getGradientColors
     * è·åæå®çº§æ°çæ¸åé¢è²æ°ç»ã
     *
     * Parameters:
     * colors - {Array{String}} é¢è²ç»ã
     * total - {Number}  é¢è²æ»æ°ã
     * total - {String}  ä¸é¢ç±»å
     *
     * Returns:
     * {Array{String}} é¢è²æ°ç»ã
     */
    static getGradientColors (colors, total, themeType){
        var ret = [], step;
        var i, n, len = colors.length;
        if (total === undefined) {
            return;
        }
        if(len >= total){
            if(themeType === 'RANGE'){
                for(i = 0; i<total; i++){
                    ret.push(colors[i]);
                }
            }else {
                //1/2åååè²
                for(i = 0; i<total; i++){
                    let ii = Math.floor(i/2);
                    if(i%2 === 0){
                        ret.push(colors[ii]);
                    }else {
                        let index = colors.length -1 - ii;
                        ret.push(colors[index]);
                    }
                }
            }
        } else {
            step = Math.ceil(total/(len-1));
            for (i = 0, n = len - 1; i < n; i++) {
                var steps = this.getStepColors(colors[i], colors[i + 1], step);
                if (i < n - 1) {
                    steps.pop();
                }
                ret = ret.concat(steps);
            }
            //å é¤å¤ä½åç´ 
            var nouse = ret.length - total;
            for(var j = 0, index = 0; j< nouse; j++){
                ret.splice(index+2,1);
            }
        }
        return ret;
    }
}
