            !this.isSearchLayer && this.map.removeLayer(this.searchResultLayer);
            this._selectMarkerFeature && this.map.removeLayer(this._selectMarkerFeature);
            this._selectFeaturethis && this.map.removeLayer(this._selectFeature);
